import React from 'react';
import { StatusProps } from '../types';
import LoadingSpinner from './LoadingSpinner';

const Status: React.FC<StatusProps> = ({
  isScraping,
  isDownloading,
  resourceCount,
  error,
  success
}) => {
  if (!error && !success && resourceCount === 0 && !isScraping && !isDownloading) {
    return null;
  }

  return (
    <div className="fixed bottom-6 right-6 space-y-3 z-50">
      {/* Error Message */}
      {error && (
        <div className="card max-w-sm bg-red-50 dark:bg-red-900/20 border-red-200 dark:border-red-800 animate-slide-up">
          <div className="flex items-start space-x-3">
            <div className="flex-shrink-0">
              <svg className="w-5 h-5 text-red-500" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 8v4m0 4h.01M21 12a9 9 0 11-18 0 9 9 0 0118 0z" />
              </svg>
            </div>
            <div className="flex-1">
              <p className="text-sm font-medium text-red-800 dark:text-red-200">
                Error
              </p>
              <p className="text-sm text-red-700 dark:text-red-300">
                {error}
              </p>
            </div>
          </div>
        </div>
      )}

      {/* Success Message */}
      {success && (
        <div className="card max-w-sm bg-green-50 dark:bg-green-900/20 border-green-200 dark:border-green-800 animate-slide-up">
          <div className="flex items-start space-x-3">
            <div className="flex-shrink-0">
              <svg className="w-5 h-5 text-green-500" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 12l2 2 4-4m6 2a9 9 0 11-18 0 9 9 0 0118 0z" />
              </svg>
            </div>
            <div className="flex-1">
              <p className="text-sm font-medium text-green-800 dark:text-green-200">
                Success
              </p>
              <p className="text-sm text-green-700 dark:text-green-300">
                {success}
              </p>
            </div>
          </div>
        </div>
      )}

      {/* Resource Count */}
      {resourceCount > 0 && !isScraping && !isDownloading && (
        <div className="card max-w-sm bg-blue-50 dark:bg-blue-900/20 border-blue-200 dark:border-blue-800 animate-slide-up">
          <div className="flex items-center space-x-3">
            <div className="flex-shrink-0">
              <svg className="w-5 h-5 text-blue-500" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 12h6m-6 4h6m2 5H7a2 2 0 01-2-2V5a2 2 0 012-2h5.586a1 1 0 01.707.293l5.414 5.414a1 1 0 01.293.707V19a2 2 0 01-2 2z" />
              </svg>
            </div>
            <div className="flex-1">
              <p className="text-sm font-medium text-blue-800 dark:text-blue-200">
                Resources Found
              </p>
              <p className="text-sm text-blue-700 dark:text-blue-300">
                {resourceCount} resources ready for download
              </p>
            </div>
          </div>
        </div>
      )}

      {/* Processing Status */}
      {(isScraping || isDownloading) && (
        <div className="card max-w-sm bg-yellow-50 dark:bg-yellow-900/20 border-yellow-200 dark:border-yellow-800 animate-slide-up">
          <div className="flex items-center space-x-3">
            <div className="flex-shrink-0">
              <LoadingSpinner size="sm" color="secondary" />
            </div>
            <div className="flex-1">
              <p className="text-sm font-medium text-yellow-800 dark:text-yellow-200">
                {isScraping ? 'Scraping' : 'Downloading'}
              </p>
              <p className="text-sm text-yellow-700 dark:text-yellow-300">
                Please wait...
              </p>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default Status;
